import React, { Component } from 'react';
import Table from '../table/Table';
import './Appointments.css';

const headers = [
  {
    key: 'title',
    label: 'Title',
  },
  {
    key: 'price',
    label: 'Price',
  },
  {
    key: 'timelimit',
    label: 'Timelimit',
  },
  {
    key: 'dateCreated',
    label: 'Date Created',
  },
  {
    key: 'actions',
    label: 'Actions',
  },
];
const data = [
  {
    id: '1',
    title: 'First',
    price: 'First',
    timelimit: 'First',
    dateCreated: 'First',
  },
  {
    id: '2',
    title: 'Second',
    price: 'Second',
    timelimit: 'Second',
    dateCreated: 'Second',
  },
];

class Appointments extends Component {
  componentDidMount() {
    this.getAppointments();
  }

  getAppointments = async () => {
    const appointments = Axios.get('/appointments', {
      headers: { Authorization: 'myJwtToken' },
    })
      .then((response) => {
        console.log('Subject successfully added.');
        alert('Subject successfully added.');
        this.props.history.push('/subjects');
      })
      .catch((error) => {
        console.log(error.response);
      })
      .finally(() => {
        console.log('Request completed.');
      });
  };

  getTableOptions = () => {
    const options = {
      customComponents: {
        actions: {
          component: (rowData) => (
            <div>
              <button
                onClick={() => {
                  console.log(rowData);
                }}
              >
                Details
              </button>
            </div>
          ),
        },
      },
    };

    return options;
  };
  render() {
    return (
      <div className='appointments_table'>
        <Table data={data} headers={headers} options={this.getTableOptions()} />
      </div>
    );
  }
}

export default Appointments;
